pragma solidity 0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";

// ignore-file-swc-108


contract Whitelist is Ownable {

  //  Events

  event AdminRoleSet(address indexed _user, bool _status);
  event UserApproved(address indexed _user, bool _status);
  event AgreementSigned(address indexed _user);

  // Immutables

  bool public immutable useApprovals;

  // Storage

  // slither-disable-next-line immutable-states
  string public agreementHash;
  mapping (address => bool) public admins;
  mapping (address => bool) public approvals;
  mapping (address => bool) public signatures;

  // Constructor

  constructor(address _owner, bool _useApprovals, string memory _agreementHash) {
    require(_useApprovals || bytes(_agreementHash).length > 0, "whitelist-bad-init");

    useApprovals = _useApprovals;
    agreementHash = _agreementHash;

    transferOwnership(_owner);
  }

  // Public

  /// @notice Sets user admin roles in the whitelist
  /// @param _users An array of user addresses
  /// @param _status The admin status to set
  function setAdminRole(address[] memory _users, bool _status) external onlyOwner {
    require(useApprovals, "whitelist-no-approvals");

    for (uint256 i; i < _users.length; i++) {
      admins[_users[i]] = _status;

      emit AdminRoleSet(_users[i], _status);
    }
  }

  /// @notice Sets user statuses in the whitelist, can only be called by admin or owner
  /// @param _users An array of user addresses
  /// @param _status The whitelist status to set
  function approveUsers(address[] memory _users, bool _status) external {
    require(useApprovals, "whitelist-no-approvals");
    require(admins[msg.sender] || owner() == msg.sender, "whitelist-not-admin");

    for (uint256 i; i < _users.length; i++) {
      approvals[_users[i]] = _status;

      emit UserApproved(_users[i], _status);
    }
  }

  /// @notice The user's signature on the agreement
  /// @param _agreementHash The agreement hash being signed
  function signAgreement(string memory _agreementHash) external {
    require(bytes(agreementHash).length > 0, "whitelist-no-agreement");
    require(
      keccak256(abi.encodePacked(agreementHash)) ==
      keccak256(abi.encodePacked(_agreementHash)),
      "whitelist-bad-signature"
    );

    signatures[msg.sender] = true;

    emit AgreementSigned(msg.sender);
  }

  /// @notice Get the user's overall whitelist status
  /// @param _user The address of the user
  function isApproved(address _user) external view returns (bool) {
    return (
      (!useApprovals || approvals[_user]) &&
      (bytes(agreementHash).length == 0 || signatures[_user])
    );
  }
}

